/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `trigger_votacao` AFTER INSERT ON `responde`
 FOR EACH ROW BEGIN
DECLARE i INT default 0;
SET i = (SELECT tipo FROM questoes WHERE questoes.id = new.questoes_id);
	IF( i  = 1) THEN
		IF( new.alternativa = 1) THEN
			update resposta_a set a = a + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 2) THEN
			update resposta_a set b = b + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 3) THEN
			update resposta_a set c = c + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 4) THEN
			update resposta_a set d = d + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 5) THEN
			update resposta_a set e = e + 1 WHERE questoes_id = new.questoes_id;
		END IF;
		ELSEIF(i = 2) THEN
		 IF( new.alternativa = 1) THEN
			update resposta_e set E1 = E1 + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 2) THEN
			update resposta_e set E2 = E2 + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 3) THEN
			update resposta_e set E3 = E3 + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 4) THEN
			update resposta_e set E4 = E4 + 1 WHERE questoes_id = new.questoes_id;
		ELSEIF (new.alternativa = 5) THEN
			update resposta_e set E5 = E5 + 1 WHERE questoes_id = new.questoes_id;
		END IF;
	END IF;
END */;;
